import { Navbar, NavbarBrand } from 'reactstrap';

function MainPage() {
  return (
    <div className="App">
      <header className="App-header">
      <div className="App">
        <Navbar dark color="primary">
          <div className="container">
           Main Page
          </div>
        </Navbar>
      </div>

      </header>
    </div>
  );
}

export default MainPage;
